export default function About() {
    return (
        <div className="about">
            <h2>About</h2>
            <p>I am a frontend developer with a particular interest <br /> in making things simple and automating daily<br /> tasks.
                I try to keep up with security and best <br /> practices, and am always looking for new things to learn.</p>
            <h2>Interests</h2>
            <p>Food expert. Music scholar. Reader. Internet fanatic. Bacon buff. Entrepreneur. Travel geek. Pop culture ninja. Coffee fanatic.</p>
        </div>
    )
}
